import React, { Component } from "react";
import "../../CSS/Style-Nosotros.css"
import Empleados from "./Empleados";
import Historia from "./Historia";

class Nosotros extends Component {
  render() {
    const DatosEmpleados = [
      {
        Fila1: [
          {
            id: 1,
            Imagen: "img/personal1@2x.png",
            Name: "Juan Manuel Gomez",
            Cargo: "Chef Ejecutivo",
          },
          {
            id: 2,
            Imagen: "img/personal2@2x.png",
            Name: "Ana Isabel Casallas",
            Cargo: "Chef Pastelera",
          },
          {
            id: 3,
            Imagen: "img/personal3@2x.png",
            Name: "María Paulina Veloza",
            Cargo: "Administradora",
          },
        ],
      },
      {
        Fila2: [
          {
            id: 4,
            Imagen: "img/Rausch.jpeg",
            Name: "Jorge Rausch",
            Cargo: "Chef auxiliar",
          },
          {
            id: 5,
            Imagen: "img/Jordy Cruz.jpeg",
            Name: "Jordy Cruz",
            Cargo: "Mesero",
          },
          {
            id: 6,
            Imagen: "",
            Name: "Nusret Gökçe",
            Cargo: "Administrador",
          },
        ],
      },
    ];
    return (
      <>
        <div className="principal-nosotros">
          <div className="history">
            <Historia/>
          </div>
          
          <div className="empleados">
            <div className="container">
              <Empleados/>
            </div>
            
          </div>
            
        </div>

      </>
    );
  }
}

export default Nosotros;
